import React from "react"
class Place extends React.Component{
    render(props) {
        let style = {
            width: "24%",
            height: "30%",
            display: "inline-block",
            border: "1px solid black"
        }
        let prop = this.props.prop;
        return <div style={style}>
            <div>Адрес: {prop}</div>
        </div>
    }
}

export  default  Place
